import React from 'react'

export default function TodoForm({todo, setTodo, handleChange ,handleSubmit}) {
  return (
    <form onSubmit={handleSubmit} className="todo-form" >
        <div class="form-wrap">
            <image src="./assets/google-task.svg" class="google_task-icon" />
            <input type="text" placeholder="Add a todo" value={todo} onChange={handleChange} name="todo" className="todo-input" />
            <button className="todo-button">Add</button>
        </div>
    </form>
  )
}
